    <nav>
      <div className="flex flex-row justify-between">

        <NavLink to="/">
          <div>
            <img src="" alt="" />
          </div>
        </NavLink>


        <NavLink to="/">
          <p>Home</p>
          <NavLink>


          </NavLink>
          <div>
            <FaShoppingCart />
          </div>
        </NavLink>

      </div>
    </nav>
  )
};

export default Navbar;
